import React from 'react'
import './assets/css/style.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useSelector } from 'react-redux';
import MovieOne from './components/MovieOne';
import MovieTwo from './components/MovieTwo';
import MovieTre from './components/MovieTre';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import Pagenotfound from './components/Pagenotfound';



function App() {
  const state = useSelector(state => state)
  const movieone = state.movie_one.initialState;

  console.log(movieone)
  return (
    <Router>
    <Link to="/">List 1</Link>
    <Link to="/2">List 2</Link>
    <Link to="/3">List 3</Link>


      <Switch>
        <Route exact path="diagnal/"><MovieOne data={movieone} /></Route>
        <Route path="diagnal/2"><MovieTwo data={movieone} /></Route>
        <Route path="diagnal/3"><MovieTre data={movieone} /></Route>
        <Route path="/*"><Pagenotfound /></Route>
      </Switch>


    </Router>

  )
}
export default App;
